import Modal from "react-modal";
export default function MovieModal({ movie, isModalOpen, closeModal }) {
  return (
    <Modal
      isOpen={isModalOpen}
      onRequestClose={closeModal}
      contentLabel={movie.Title}
    ></Modal>
  );
}
